    <div class="find-location-button" onclick="findMyLocation()">üìç Find My Location</div>

    <script>
        function findMyLocation() {
            if (navigator.geolocation) {
                navigator.geolocation.getCurrentPosition(function(position) {
                    var lat = position.coords.latitude;
                    var lng = position.coords.longitude;
                    var map = {my_map.get_name()};
                    map.setView([lat, lng], 15);
                    L.marker([lat, lng]).addTo(map)
                        .bindPopup("<strong>You are here</strong>").openPopup();
                }, function(error) {
                    alert("Unable to retrieve your location. Ensure HTTPS is enabled.");
                });
            } else {
                alert("Geolocation is not supported by this browser.");
            }
        }
    </script>
